  \"2016-01-28T05:15:06.884556\",\n\t\"name\": \"city-of-somerville-assessors-valuations-fy15\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The State Department of Revenue (DOR) has
  approved assessed values for Fiscal Year (FY) 2015 for the Somerville Board of Assessors.
  The assessed values and data presented relects information available for the FY
  2015 actual tax bill issued around January 1, 2015.  Assessments for FY 2015 have
  an effective market date of January 1, 2014.rnrnNote that ownership information
  shows record owner as of January 1, 2014.  However, a second line of owneship, if
  applicable, showing \"S/O\" indicates a subsequent owner who purchased the property
  after January 1, 2014 but prior to January 1, 2015.  In this instance, title information
  including sale price, sale date, and book & page will not appear in the data base
  until next year or for the third quarter tax bill for FY 2016 issued around  January
  1, 2015.  New ownership information is provided through about early October of 2014.\",\n\t\"license_title\":
